    % 'CBF' = Conventional Beamforming DOA
    % 'MUSIC' = MUSIC without interference suppression feature.
    % 'AntiInterMUSIC' = MUSIC with interfernece suppression feature.
    
    
    ShowConfiguration(sysPara);                     %% print simulation configuration.
